import { Link as Scrollto} from "react-scroll";
import styled from "styled-components";
import { NavBar } from "../../store/styedComponents/styledDividers/styledDividers";

const NavComponent = () => {
  return (
    <NavBar>
      <Scrollto
        to="landingPage"
        spy={true}
        smooth={true}
        duration={400}
        activeClass="border-bottom: 2 px solid red"
      >
        Home
      </Scrollto>
      <Scrollto
        to="main"
        spy={true}
        smooth={true}
        duration={400}
      >
        About
      </Scrollto>
      {/* <li>
        Work
      </li> */}
      <Scrollto
        to="contact-form"
        spy={true}
        smooth={true}
        duration={400}
      >
        Contact
      </Scrollto>
    </NavBar>
  );
};

export default NavComponent;
